import React, { useEffect, useState } from 'react';
import { Container, Typography, Grid, Card, CardContent, CardMedia, Button, TextField, Box } from '@mui/material';
import axiosInstance from '../api/axiosConfig';

const CandidatePage = () => {
  const [candidates, setCandidates] = useState([]);
  const [formData, setFormData] = useState({
    name: '',
    photo: null,
    party: '',
    age: '',
    experience: ''
  });

  useEffect(() => {
    axiosInstance.get('/api/candidate')
      .then(response => setCandidates(response.data))
      .catch(error => console.error('Error fetching candidates:', error));
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleFileChange = (e) => {
    setFormData({ ...formData, photo: e.target.files[0] });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const data = new FormData();
    data.append('name', formData.name);
    data.append('photo', formData.photo);
    data.append('party', formData.party);
    data.append('age', formData.age);
    data.append('experience', formData.experience);

    axiosInstance.post('/api/candidate/add', data)
      .then(response => {
        setCandidates([...candidates, response.data]);
        setFormData({
          name: '',
          photo: null,
          party: '',
          age: '',
          experience: ''
        });
      })
      .catch(error => console.error('Error adding candidate:', error));
  };

  return (
    <Container>
      <Typography variant="h4" gutterBottom>Candidate List</Typography>
      <Box component="form" onSubmit={handleSubmit} sx={{ mb: 4 }}>
        <TextField
          label="Name"
          name="name"
          value={formData.name}
          onChange={handleInputChange}
          fullWidth
          required
          sx={{ mb: 2 }}
        />
        <TextField
          type="file"
          name="photo"
          onChange={handleFileChange}
          fullWidth
          required
          sx={{ mb: 2 }}
        />
        <TextField
          label="Party"
          name="party"
          value={formData.party}
          onChange={handleInputChange}
          fullWidth
          required
          sx={{ mb: 2 }}
        />
        <TextField
          label="Age"
          name="age"
          type="number"
          value={formData.age}
          onChange={handleInputChange}
          fullWidth
          required
          sx={{ mb: 2 }}
        />
        <TextField
          label="Experience"
          name="experience"
          value={formData.experience}
          onChange={handleInputChange}
          fullWidth
          required
          sx={{ mb: 2 }}
        />
        <Button type="submit" variant="contained" color="primary">Add Candidate</Button>
      </Box>
      <Grid container spacing={4}>
        {candidates.map(candidate => (
          <Grid item key={candidate.id} xs={12} sm={6} md={4}>
            <Card>
              <CardMedia
                component="img"
                height="140"
                image={`data:image/jpeg;base64,${candidate.photo}`}
                alt={candidate.name}
              />
              <CardContent>
                <Typography variant="h5">{candidate.name}</Typography>
                <Typography variant="body2" color="textSecondary">{candidate.party}</Typography>
                <Typography variant="body2" color="textSecondary">Age: {candidate.age}</Typography>
                <Typography variant="body2" color="textSecondary">Experience: {candidate.experience}</Typography>
              </CardContent>
              <Button variant="contained" color="secondary" onClick={() => deleteCandidate(candidate.id)}>
                Delete
              </Button>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );

  function deleteCandidate(id) {
    axiosInstance.delete(`/api/candidate/${id}`)
      .then(() => setCandidates(candidates.filter(candidate => candidate.id !== id)))
      .catch(error => console.error('Error deleting candidate:', error));
  }
};

export default CandidatePage;
